  input: TEXT,F3XA,,"Reference Report for filing period 7/1/02 - 9/30/02 and your
    letter dated April 9, 2002.  An inquiry into contributions made to Senator John
    Warner Committee for the 2002 Election has shown that we incorrectly designated
    a contribution made on September 10, 1998 as being for the general election, which
    made it appear we over contributed to his general election.  A Schedule B designating
    this contribution to the primary election has been submitted to Mr. Edward Ryan,
    Campaign Finance Analyst, Federal Election Commission.  This contribution clearly
    should have been designated to Senator Warner's primary election campaign as it
    was too early to contribute to the general election of 2002 at that time."
